(118, 4599, 'staomy', 'staomy@gmail.com', '', '14.177.38.0', '2018-12-07 16:11:29', '2018-12-07 16:11:29', 'Pretty incredible property, was definitely a bucket list stay for me. Only issue was there was construction next door so there were petty loud noises both mornings at 8:30 that made it hard to sleep. But the house is very pretty and unique, really loved the pool too. Hosts were friendly and helpful. Easy to recommend.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_13_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/12.0.1 Safari/605.1.15', 'st_reviews', 0, 4),
