(154, 4599, 'travelhotel', 'contact@shinetheme.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 03:57:40', '2018-12-11 03:57:40', 'Ample, stylish, great location, great beds, elevator available. Air conditioning perfect for summers in Madrid. The janitor Nacho is nice and helpful. Totally recommend.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(155, 4598, 'travelhotel', 'contact@shinetheme.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:00:02', '2018-12-11 04:00:02', 'My parents and I recently stayed four nights at Faire’s apartment. It is a wonderful apartment, very modern, spacious and was very clean. Location is great, right in the Salamanca neighborhood, close to many bars and restaurants. Entrance process was very efficient and I didn’t not have any issues during the stay. Thanks for a great stay Faire!', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(156, 6555, 'Travis Tan', 'phpleaderpro@gmail.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:44:42', '2018-12-11 04:44:42', 'Great location, extremely clean and brand new amenities. huge bedrooms, bathrooms and closets. Would recommend to anyone. Great value.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(157, 4765, 'Travis Tan', 'phpleaderpro@gmail.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:48:15', '2018-12-11 04:48:15', 'A spacious apartment on first floor with 2 double bedrooms, 3 bathrooms and a vast amount of closet space. It was so good to have all that extra space on our 4 night stay compared with a hotel room.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(158, 4605, 'Travis Tan', 'phpleaderpro@gmail.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:49:21', '2018-12-11 04:49:21', 'Faire is a phenomenal host, easy to communicate and responds immediately to messages. The apartment is magnificent, much better than what you see in the pictures! It is beautiful, comfortable, and functional, with high-end finishings, and located on a quiet street.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(159, 4597, 'Travis Tan', 'phpleaderpro@gmail.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:49:53', '2018-12-11 04:49:53', 'We would highly recommend this flat. Excellent location, very spacious, well furnished and maintained, fitted to a high standard and managed by an accessible and responsive team.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
(160, 4601, 'Travis Tan', 'phpleaderpro@gmail.com', 'http://travelhotel.wpengine.com', '117.4.243.164', '2018-12-11 04:56:53', '2018-12-11 04:56:53', 'A spacious apartment on first floor with 2 double bedrooms, 3 bathrooms and a vast amount of closet space. It was so good to have all that extra space on our 4 night stay compared with a hotel room. Corporately owned so their representative comes to check you in and collect a cash security deposit and checks you out and returns your deposit. Newly re-furbished to high standard and quiet. Not in the touristy part of Madrid but we wanted proximity to the IE business school. Will be happy to stay again.', 0, '1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.110 Safari/537.36', 'st_reviews', 0, 2),
